    // Get a random map from the selection
    public static int[][] GetRandomMap()
    {
        int[][] returnedMap;
        switch (Random.Range(0, 3))
        {
            case 0:
                returnedMap = map1;
                break;
            case 1:
                returnedMap = map2;
                break;
            case 3:
                returnedMap = map3;
                break;
            default:
                returnedMap = map1;
                break;
        }

        return returnedMap;
    }
